import './App.css';
import { TocRounded } from '@material-ui/icons';

const App = () => {
  return (
    <div className='App'>
      <div className='sidebar-container'>
        <div className='sidebar'>

          {/* Lines Icon */}
          <div className='lines-icon'>
            <TocRounded />
          </div>

          {/* Profile Image */}
          <div className='profile'>
            <img
              src="https://ae01.alicdn.com/kf/H5be6a0fa5f584a8a8420da2a7d4bc809r/RBRARE-Polaroid-Men-s-Goggle-Driving-Sunglasses-Men-Classic-Low-Profile-Sun-Glasses-For-Men-High.jpg"
              alt='profile'
            />
            </div>
        </div>
      </div>
      <div className='body-container'>Body</div>
    </div>
  )
}

export default App
